function Home() {
  return (
    <div className="home-content">
      <div className="text-section">
      
        <p><strong>B</strong>ienvenue sur <strong>نبض التطوع.</strong> 
           Cette plateforme réunit ceux qui veulent donner de leur temps et ceux qui ont besoin de soutien. 
          Ensemble, faisons une réelle différence dans nos communautés.</p>
      </div>
      <div class="col-sm d-flex justify-content-center ">
        <img src="im" width="480" height="250" style="margin-top: 10%;" />
      </div>
    </div>
  );
}

export default Home;
